import React from 'react';
import './FeedbackSection.css';

const FeedbackSection = () => {
  return (
    <section className="feedback-section">
      <div className="container">
        <h2>What Our Users Say</h2>
        <div className="feedback-grid">
          <div className="feedback-card">
            <p>"Great way to earn rewards while shopping!"</p>
            <span className="user-name">- Sarah M.</span>
          </div>
          <div className="feedback-card">
            <p>"Love how easy it is to track my points!"</p>
            <span className="user-name">- Mike R.</span>
          </div>
          <div className="feedback-card">
            <p>"Best rewards program I've ever used!"</p>
            <span className="user-name">- Lisa K.</span>
          </div>
        </div>
      </div>
    </section>
  );
};

export default FeedbackSection;
